import React from "react";
import style from './Tasks.css';

const Tasks = ({listItems, addListItem, editListItem, deleteListItem}) =>{
    if(listItems.length > 0){
        return(
            <ul className={style.ul}>
                {
                    listItems.map((val, index) =>{
                        return <li className={style.li} key={index}>{val}<button>Complete</button></li>
                    })
                }
            </ul>
        );
    }else{
        return(
            <ul className={style.ul}>
                <li className={style.li} >No Tasks Scheduled</li>
            </ul>

        )
    }

}

export default Tasks;
